**Step 3: Create the Express.js server**

Create a new file called `server.js` and add the following code:
```javascript
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let data = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
];

app.get('/api/data', (req, res) => {
  res.json(data);
});

app.post('/api/data', (req, res) => {
  const { name, age } = req.body;
  const id = data.length + 1;
  data.push({ id, name, age });
  res.json({ message: 'Data added successfully' });
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code sets up an Express.js server that listens on port 3001 and has two endpoints: one to retrieve the dummy data and another to add new data.

**Step 4: Create the React app**

Create a new file called `index.js` and add the following code:
```javascript
import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';

function App() {
  const [data, setData] = useState([]);
  const [name, setName] = useState('');
  const [age, setAge] = useState('');

  useEffect(() => {
    fetch('/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    fetch('/api/data', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ name, age }),
    })
      .then(response => response.json())
      .then(data => console.log(data));
  };

  return (
    <div>
      <h1>Dummy Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.name} ({item.age})</li>
        ))}
      </ul>
      <form onSubmit={handleSubmit}>
        <input type="text" value={name} onChange={(event) => setName(event.target.value)} placeholder="Name" />
        <input type="number" value={age} onChange={(event) => setAge(event.target.value)} placeholder="Age" />
        <button type="submit">Add Data</button>
      </form>
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById('root'));
```
This code sets up a React app that fetches the dummy data from the Express.js server and displays it in a list. It also has a form to add new data, which sends a POST request to the Express.js server.

